Once you have completed the circuit you will need to programme the Arduino Uno. Click the Code Text located above Components . Once sketch has appeared, reproduce the following code: void setup()
{ } void loop()
{ } Now you are ready to set up all of the Sketch up as follows. #define en 10
#define in1 9
#define in2 8
#define temp A0 void setup()
{ } void loop()
{ } Firstly, the variables are declared and initialised using the #define keyword. Lines 1 to 3 define the variables en 10, in1 9 and in2 8 and will reference the physical connections of the L293D: Enable 1 & 2, Input 1 , and Input 2 respectively. Line 4, defines the variable temp A0 which will reference the physical connection of the TMP36 temperature sensorVout pin. TODO: Add inline comments on lines 1 - 4 for what each variable is for, using the // comment symbols Secondly, the dynamic variables are declared and initialised using data types int, float and bool. float pwmOutput = 12;
float tempValue;
float temperature;
float rads = 0.0;
float degrees = 0.0;
bool movedRight = false;
bool movedLeft = false; Line 6, float pwmOutput = 12;, will store the value that will be used in the analogWrite() function. Use float and not int! Lines 7 and 8, variables float tempValue; float temperature; respectively, will store the analogRead() value and the converted temperature value respectively. Lines 9 and 10, variables float rads =0.0; and float degrees = 0.0; respectively, will store the calculated values for radians per second and degrees per second respectively. Lines 11 and 12, variables bool movedRight = false; and bool movedLeft = false; respectively, are used to stop the motor turning continuously. Lines 13-15 include some more variables that will be used to calculate RPM. Speciifcally, line 13 contains rpm (to store the calculated rounds per minute), line 14 contains PWM (which stores the percentage of the total voltage used in the modulation), and line 15 contains lnOhm: this will be used to store the natural logarithm of the resistance value. You will need to enter this resistance value in the code manually every time you change the value on the resistor. The script should now look like this: #define en 10
#define in1 9
#define in2 8
#define temp A0 float pwmOutput = 12;
float tempValue;
float temperature;
float rads = 0.0;
float degrees = 0.0;
bool movedRight = false;
bool movedLeft = false;
float rpm = 0;
float PWM = (pwmOutput)*100/255;
float lnOhm = 0; void setup()
{ } void loop()
{ } TODO: Add inline comments on lines 6 - 15 for what each variable is for, using the // comment symbols The void setup() will be used to set the pin modes and initialise the serial. void setup()
{ Serial.begin(9600); pinMode(en, OUTPUT); pinMode(in1, OUTPUT); pinMode(in2, OUTPUT);
} Line 19's code, Serial.begin(9600);, sets the Serial speed at 9600 bits per second (bps) Line 20's code, pinMode(en, OUTPUT);, sets pin 10 on the Arduino Uno as an output so that a signal can be sent to the Enable 1 & 2 pins of the L293D chip. Code of line 21 and 22, pinMode(in1, OUTPUT); pinMode(in2, OUTPUT) respectively, set pin 9 and 8 on the Arduino Uno as outputs so that a signal can be sent to the Input 1 & 2 pins of the L293D chip respectively. #define en 10
#define in1 9
#define in2 8
#define temp A0 int pwmOutput = 12;
float tempValue;
float temperature;
float rads = 0.0;
float degrees = 0.0;
bool movedRight = false;
bool movedLeft = false; void setup()
{ Serial.begin(9600); pinMode(en, OUTPUT); pinMode(in1, OUTPUT); pinMode(in2, OUTPUT);
} void loop()
{ } TODO: Add inline comments on lines 16 - 19 for what each variable is for, using the // comment symbols void loop()
{ tempValue = analogRead(temp); temperature = ((tempValue*(5.0/1024.0))-0.5)/0.01; if( temperature <= 30.0 && movedRight == false) { motorInstructions(); debugger(); digitalWrite(in1, LOW); digitalWrite(in2, HIGH); delay(1000); digitalWrite(in2, LOW); movedRight = true; movedLeft = false; } else if ( temperature >= 40.0 && movedLeft == false) { motorInstructions(); debugger(); digitalWrite(in1, HIGH); digitalWrite(in2, LOW); delay(1000); digitalWrite(in1, LOW); movedLeft = true; movedRight = false; }
} Starting with line 27, the code tempValue = analogRead(temp); will read the TMP36 wired to pin A0 of the Arduino, and convert voltage to the Analogue Digital Converted value. Remember, the voltage range is 0V to 5V, and the ADC of the Arduino is 10-bits, so its range is 0 - 1023. Line 28's code, temperature = ((tempValue*(5.0/1024.0))-0.5)/0.01;}, converts the the temp value, (0 - 358), to degrees Celsius with a range of \(-40^{\circ}C\) to \(125^{\circ}C\), see equation 6 : \[ \begin{aligned} \cfrac{\left(\left(tempValue \cdot \left( \cfrac{5.0V}{1024}\right)\right)-0.5\right)}{0.01} &amp;= temperature \end{aligned}\tag{Eqn:6} \] \[ \begin{aligned} e.g., \cfrac{\left(\left(156 \cdot \left( \cfrac{5.0V}{1024}\right)\right)-0.5\right)}{0.01} &amp;= 26.17^{\circ}C \end{aligned} \] TODO: Add inline comments on lines 27 - 28 for what each variable is for, using the // comment symbols Now that the temperature value has been calculated, lines 27 and 41 can be explained. Line 29's code, if( temperature <= 30.0 && movedRight == false), checks to see if the temperature is less than or equal to, <=, 30.0. If this condition is true then the second part of the conditional statement can be checked, using &&. The boolean (true or false) variable movedRight == false is compared for equality ==. Now if both conditions are true then the code between lines 30 and 39 will be executed. If either statement is false, then line 40 is executed. NOTE: a single = means assign the right hand side value to the left hand side, whereas double == is a comparison operator. Line 42's code is much the same as line 31's, but the temperature has to be greater or equal to, >=, 40.0 and movedLeft must be false. If both statements are true then lines 42 to 49 are executed. If either or both statements are false then the programme loops back to the line 25, and the process starts again. When looking inside lines 31 to 38 & lines 42 to 49, you can see that there are only a few differences between the two blocks of code. We will look at lines 31 - 32 and 42 - 43 later. Lets look at lines 33 - 34 and 44 - 45, where the two sets of lines are polar opposites of each other. The digitalWrite(in1, LOW); digitalWrite(in1, HIGH); & digitalWrite(in2, LOW); digitalWrite(in2, HIGH); changes the direction the motor spins. Looking at the block diagram of the L293D bridge, we can see that Input 1 (pin 3 on the bridge) and Input 2 (pin 7 on the bridge) change the direction of the motor. The code of lines 35 and 46, delay(1000), gives the motor 1 second to turn in the programmed direction. TODO: Add inline comments on lines 33 - 36 & 44 - 48 for what each variable is for, using the // comment symbols Lines 37 - 38, and 48 - 49 both set the movedLeft and movedRight variables as true or false. Now it is time to return to lines 31 & 42. Both sets of lines do the same things, so look below at the code for motorInstructions();, which is added to end of the script after the closing } of the void loop(). void motorInstructions()
{ lnOhm = log(1000); rpm = (14.449*pow(lnOhm,4)-100.83*pow(lnOhm,3)-354.06*pow(lnOhm,2)+309.41*lnOhm+16273)*(PWM/100); rads = rmp*0.10472; degrees = rads * 57.2958; analogWrite(en, pwmOutput);
} Let's first look at line 54's code: lnOhm = log(1000);. This code gives us the natural logarithm (ln) of the resistor value. The value in the paranthesis is the resistance value in Ohm, e.g., 1KΩ = 1000Ω. You will need to change this value every time you change the value on the resistor. This value is needed to calculate the rounds per minute of the motor. Line 55 gives us a polynomial equation specific to this system. It is used to calculate the motor's rounds per minute using the aforementioned resistor value. It also changes linearly with the PWM: decreasing the PWM by half changes the result of the rpm equation by half. The code in line 56 calculates the radians per second, whereby 1rad/s = 60rad/min = 60/2π rpm = 9.549297 rpm . Line 57's code, degrees = rads * 57.2958;, is taken from equation 4 and is used to calculate degrees per second. Line 58's code, analogWrite(en, pwmOutput);, outputs the PWM signal,pwmOutput, value of 12 to the en pin, to the Enable 1 & 2 pin of the L293D. The value of en, 12, again is preset because of the resistor's initial value of \(1k\Omega\). So lastly, lets look at the function debugger();, called on lines 32 and 43 of the void loop() function. void debugger()
{ Serial.print("Temperature: "); Serial.print(temperature); Serial.print(" | RAD/s: "); Serial.print(rads); Serial.print(" | Degree/s: "); Serial.print(degrees); Serial.print(" | rpm: "); Serial.println(rpm);
} Lines 64 to 71 output information about the variables to the serial montior. Now you have a better understanding of the circuit and the code ... TODO: What happens to the motor when the resistance value is changed? Adjust line 54's value to match the resistance on the resistor. Why are we using float for some variables and int for others? What would happen if, for example, we defined PWM or lnOhm via int instead of float? Why was #define used on some variables? With the knowledge that each line of code takes some time to execute, specifically mathematical functions, would pre-calculating all of the constants in an equation speed up the programme? Try it. Explore the code; make changes to experiment with different temperature values, PWM values, timings, and conditional statements (if, else if). The full code is seen below: #define en 10
#define in1 9
#define in2 8
#define temp A0 int pwmOutput = 12;
float tempValue;
float temperature;
float rads = 0.0;
float degrees = 0.0;
bool movedRight = false;
bool movedLeft = false;
float rpm = 0.0;
float PWM = (pwmOutput)*100/255;
float lnOhm = 0; void setup()
{ Serial.begin(9600); pinMode(en, OUTPUT); pinMode(in1, OUTPUT); pinMode(in2, OUTPUT);
} void loop()
{ tempValue = analogRead(temp); temperature = ((tempValue*(5.0/1024.0))-0.5)/0.01; if( temperature <= 30.0 && movedRight == false) { motorInstructions(); debugger(); digitalWrite(in1, LOW); digitalWrite(in2, HIGH); delay(1000); digitalWrite(in2, LOW); movedRight = true; movedLeft = false; } else if ( temperature >= 40.0 && movedLeft == false) { motorInstructions(); debugger(); digitalWrite(in1, HIGH); digitalWrite(in2, LOW); delay(1000); digitalWrite(in1, LOW); movedLeft = true; movedRight = false; }
} void motorInstructions()
{ lnOhm = log(1000); rpm = (14.449*pow(lnOhm,4)-100.83*pow(lnOhm,3)-354.06*pow(lnOhm,2)+309.41*lnOhm+16273)*(PWM/100); rads = rpm*0.10472; degrees = rads * 57.2958; analogWrite(en, pwmOutput);
} void debugger()
{ Serial.print("Temperature: "); Serial.print(temperature); Serial.print(" | Radians/s: "); Serial.print(rads); Serial.print(" | Degrees/s: "); Serial.print(degrees); Serial.print(" | rpm "); Serial.println(rpm);
}
